$(function(){var serverBasic="http://"+location.host+"/",trTemplate='<tr class="odd gradeX">\n                            <td>{{Method}}</td>\n                            <td>{{Precent}}%</td>\n                            <td>{{Time}}s</td>\n                        </tr>',listCount=25,freshProfileList=function(t){$("#profile-list").html("");for(var e=0;e<t.length;e++)if(!t[e].error){var i=trTemplate.replace(/{{Method}}/g,t[e].Method).replace(/{{Precent}}/g,t[e].Precent.toFixed(2)).replace(/{{Time}}/g,t[e].Time.toFixed(2));$("#profile-list").append(i)}};setInterval(function(){$("#profile-panel").is(":visible")&&$.get(serverBasic+"/vm_profile_list/"+$("#vm-id").val()+"/"+listCount,function(data){freshProfileList(eval("("+data+")"))})},1e3),$(".profile-list-count").change(function(){listCount=$(this).val()})});